import { BrowserRouter as Routes, Switch, Route } from 'react-router-dom';
import { Home } from './Pages/Home';
import PerfilUsuario from './Layouts/PerfilDesplegable';
import NavBar from './Layouts/NavBar';

function App() {
  return (
  <Routes>
    <NavBar />
      <Switch>
        <Route path="/home" component={PerfilUsuario} />
        <Route path="/" component={Home} />
      </Switch>
  </Routes>
  );
}

export default App;
